import React from "react";
import "./Body.css";
import Card from "./Card/Card";


export default function Body(){
    return(
        <>
            <div className="b">
                 <div className="b-RP">
                     <h1>Romantic Playlist</h1>
                       <div className="b-wrap">
                       <Card num={0}/>
                       <Card num={1}/>
                       <Card num={2}/>
                       <Card num={3}/>
                       <Card num={4}/>
                       </div>
   
                 </div>
                 <div className="b-FP">
                      <h1 style={{top:"2rem",left:"2rem"}}>Your's Favourite</h1>
                 </div>
                 <div className="b-SP">

                 </div>
            </div>
        </>
    );
}
